import React from "react";
import {Tile} from '../tile/Tile';

export const TileList = ({contacts}) => {
  return (
    <div>
      {contacts && contacts.map((contact, index) => {
        return <Tile name={contact.name} description={{...contact, name: undefined}} />
      })}
    </div>
  );
};
